import { FaInstagram, FaFacebook, FaTwitter } from "react-icons/fa";
const Footer = () => {
  return (
    <div className="footer d-flex flex-row hustify-content-center align-items-center">
      <div className="p-0 m-0 col-md-4 d-flex flex-row justify-content-center align-items-center">
        <ul className=" d-flex flex-row justify-content-center align-items-center">
          <li className="p-3 m-1 ">
            <FaInstagram />
          </li>
          <li className="p-3 m-1 ">
            <FaFacebook />
          </li>
          <li className="p-3 m-1 ">
            <FaTwitter />
          </li>
        </ul>
      </div>
      <div className="p-0 m-0 col-md-8 d-flex flex-column justify-content-center align-items-center">
        <h5>Visit us at :</h5>
        <strong>Shiraz kasayi st.</strong>
      </div>
    </div>
  );
};

export default Footer;
